// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract TeamRegistry {
    struct Team {
        uint256 id;
        string social_name;
        string name;
        string email;
        string city;
        string found_date;
    }

    mapping(uint256 => Team) public teams;

    function addTeam(
        uint256 _id,
        string memory _social_name,
        string memory _name,
        string memory _email,
        string memory _city,
        string memory _found_date
    ) public {
        teams[_id] = Team(_id, _social_name, _name, _email, _city, _found_date);
    }

    function getTeam(uint256 _id) public view returns (Team memory) {
        return teams[_id];
    }
}
